('node', 'article', 0, 10, 10, 'und', 0, '<p>Для &nbsp;зручної організації загрузки картинок в Drupal 7 можна використати модуль IMCE що інтегрується у графічний редактор CKEditor.&nbsp;</p>\r\n\r\n<p>1. Встановити модуль&nbsp;<br />\r\nhttps://www.drupal.org/project/imce</p>\r\n\r\n<p>2. У налаштуваннях&nbsp;&nbsp;CKEditor&nbsp;/admin/config/content/ckeditor у необхідних профілях в&nbsp;SHOWEDITOR APPEARANCE перенести іконку IMCE в Current toolbar.</p>\r\n\r\n<p>І увімкнути&nbsp;Plugin for inserting files from IMCE without image dialog</p>\r\n', '', 'filtered_html'),
('node', 'article', 0, 11, 11, 'und', 0, '<h3><strong>500</strong></h3>\r\n\r\n<h3>Найщастіше&nbsp;причиною&nbsp;помилки&nbsp;500 (Internal Server Error, внутрішня помилка&nbsp;сервера) є&nbsp;невірний синтаксис файла .htaccess або нявність в ньому&nbsp;непідтримуваних директив. Частіше&nbsp;всього достатьньо&nbsp;закомментувати&nbsp;директиву Options (для цього потрібно&nbsp;поставити&nbsp;спочатку рядка&nbsp;решітку&nbsp;— #), і&nbsp;проблема пропаде.</h3>\r\n\r\n<p>Помилка&nbsp;500 також&nbsp;може з*являтись внаслідок&nbsp;неправильного поводження з&nbsp;CGI-скриптами:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>CGI-скрипти&nbsp;повинні мати закінчення рядків&nbsp;в форматі&nbsp;UNIX (\\n), а не в форматі&nbsp;Windows (\\r\\n). Для цього їх потрібно загружати на сервер по FTP в режимі&nbsp;ASCII.</p>\r\n	</li>\r\n	<li>\r\n	<p>CGI-скрипти&nbsp;і&nbsp;папки, в котрих вони знаходятся, повинні&nbsp;бути&nbsp;доступні&nbsp;для запису&nbsp;тільки власнику, тобто мати права&nbsp;0755 (drwxr-xr-x).</p>\r\n	</li>\r\n	<li>\r\n	<p>В результате работы CGI-скрипта сформированны неправильные HTTP-заголовки ответа. В этом случае для решения проблемы полезно обратиться к error_log (его можно найти в контрольной панели в разделе «Хостинг / Статистика / Лог-файлы / Ошибки»).</p>\r\n	</li>\r\n</ul>\r\n', '', 'filtered_html'),
('node', 'article', 0, 12, 12, 'und', 0, '<p>Обов*язкові параметри&nbsp;</p>\r\n\r\n<ul>\r\n	<li><em>name = Example theme</em></li>\r\n	<li><em>core = 7.x</em></li>\r\n</ul>\r\n\r\n<p>Регіони за замовчуванням</p>\r\n\r\n<ul>\r\n	<li>regions[page_top] = Page Top</li>\r\n	<li>regions[header] = Header</li>\r\n	<li>regions[highlight] = Highlight</li>\r\n	<li>regions[help] = Help</li>\r\n	<li>regions[content] = Content</li>\r\n	<li>regions[sidebar_first] = Sidebar First</li>\r\n	<li>regions[sidebar_second] = Sidebar Second</li>\r\n	<li>regions[footer] = Footer</li>\r\n	<li>regions[page_bottom] = Page Bottom</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'filtered_html');
